import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = ({ isAuthenticated, isAdmin, handleLogout }) => {
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogoutClick = () => {
    handleLogout();
    navigate('/');
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <nav className="bg-gradient-to-r from-blue-600 to-indigo-700 shadow-lg sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          <div className="flex items-center">
            <Link to="/" className="text-2xl font-bold text-white hover:text-gray-200 transition duration-150">
              CinemaBooking
            </Link>
          </div>
          {/* Desktop Menu */}
          <div className="hidden md:flex items-center space-x-4">
            <Link to="/" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150">Trang chủ</Link>
            {isAuthenticated ? (
              <>
                <Link to="/bookings" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150">Vé của tôi</Link>
                <Link to="/profile" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150">Tài khoản</Link>
                {isAdmin && (
                  <Link to="/admin" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150">Quản trị</Link>
                )}
                <button 
                  onClick={handleLogoutClick} 
                  className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150 bg-indigo-500 hover:bg-indigo-600"
                >
                  Đăng xuất
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150">Đăng nhập</Link>
                <Link to="/register" className="text-gray-100 hover:text-white px-3 py-2 rounded-md text-sm font-medium transition duration-150 bg-green-500 hover:bg-green-600">Đăng ký</Link>
              </>
            )}
          </div>
          {/* Mobile Menu Button */}
          <div className="md:hidden flex items-center">
            <button 
              onClick={toggleMobileMenu}
              className="text-gray-200 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white ml-3 p-2 rounded-md"
            >
              <svg className="h-6 w-6" stroke="currentColor" fill="none" viewBox="0 0 24 24">
                {isMobileMenuOpen ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {isMobileMenuOpen && (
        <div className="md:hidden bg-indigo-600">
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
            <Link to="/" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150" onClick={toggleMobileMenu}>Trang chủ</Link>
            {isAuthenticated ? (
              <>
                <Link to="/bookings" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150" onClick={toggleMobileMenu}>Vé của tôi</Link>
                <Link to="/profile" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150" onClick={toggleMobileMenu}>Tài khoản</Link>
                {isAdmin && (
                  <Link to="/admin" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150" onClick={toggleMobileMenu}>Quản trị</Link>
                )}
                <button 
                  onClick={() => { handleLogoutClick(); toggleMobileMenu(); }}
                  className="w-full text-left text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150 bg-indigo-500 hover:bg-indigo-600"
                >
                  Đăng xuất
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150" onClick={toggleMobileMenu}>Đăng nhập</Link>
                <Link to="/register" className="text-gray-100 hover:text-white block px-3 py-2 rounded-md text-base font-medium transition duration-150 bg-green-500 hover:bg-green-600" onClick={toggleMobileMenu}>Đăng ký</Link>
              </>
            )}
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
